// Home.js
import React from 'react';
import { Carousel } from 'react-bootstrap';
import image1 from './Images/image1.jpg';
import image2 from './Images/image2.jpg';
import image3 from './Images/image3.jpg';
import image4 from './Images/image4.jpg';
import image5 from './Images/image5.jpg';
import './App.css';

function Home() {
  return (
    <div className="home-content">
      <Carousel className="custom-carousel">
        <Carousel.Item>
          <img className="d-block w-100" src={image1} alt="First slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={image2} alt="Second slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={image3} alt="Third slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={image4} alt="Fourth slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={image5} alt="Fifth slide" />
        </Carousel.Item>
      </Carousel>
      <div className="text-content">
        <h2>Articles: Profiles and analyses of notable actors.</h2>
        <h2>Nomination: Insights on SAG Awards nominees and achievements.</h2>
        <h2>Awards: Recognitions for excellence in various film categories.</h2>
      </div>
    </div>
  );
}

export default Home;
